import React from "react";
import { View, Text, Heading, Center, NativeBaseProvider,Stack, Container, Image } from "native-base";
import { SafeAreaView } from "react-native";




const AboutCinema = () => {
    return(
        <SafeAreaView>
                <Center >
                    <Image margin={'20'} size={'2xl'} source={require('../../resources/popi.gif')} alt="Loading" />
                </Center>
        <Text>LoadPage</Text>
        </SafeAreaView>

    )
};

export default AboutCinema;
